);      }    }  }  function wrap(el, wrapper) {    wrapper.className = "gallery-photo";    el.parentNode.insertBefore(wrapper, el);    wrapper.appendChild(el);  }  //相册瀑布流  let galleryPhotos = document.querySelectorAll('.gallery-photos') || ''  if(galleryPhotos){    imgStatus.watch('.gallery-photo img', function(imgs) {      if(imgs.isDone()){        for(var i=0;i < galleryPhotos.length;i++){          waterfall(galleryPhotos[i]);          let pagePhoto = galleryPhotos[i].querySelectorAll('.gallery-photo');          for(var j=0;j < pagePhoto.length;j++){pagePhoto[j].className += " visible"};        }      }    });    window.addEventListener('resize', function () {      for(var i=0;i < galleryPhotos.length;i++){        waterfall(galleryPhotos[i]);      }    });  }});</script><gallery><img src=https://picx.zhimg.com/v2-e1de4ebfa03b051bbc7e565a89d18af6_r.webp?source=1940ef5c><br><img src=https://pica.zhimg.com/v2-5ed8345de5e573f5dceef9ed8cb3af92_r.webp?source=2c26e567><br><img src=https://pic1.zhimg.com/v2-cb8fd9ee3ea919f6b75b3f065ebe80c4_r.webp?source=2c26e567><br><img src=https://pic1.zhimg.com/v2-5aa557be265da90528cfcf24a358539f_r.webp?source=2c26e567><br><img src=https://picx.zhimg.com/v2-c3601d6a583e7e4fe011189058fb6264_r.webp?source=2c26e567><br><img src=https://pic1.zhimg.com/v2-fc4a719c0708b80d16f112e17bc5376c_r.webp?source=2c26e567><br><img src=https://picx.zhimg.com/v2-21b5f656ed25736fc770777d8240c066_r.webp?source=2c26e567><br><img src=https://pica.zhimg.com/v2-600f3699efda51d7a5b7f18488522d89_r.webp?source=2c26e567><br><img src=https://picx.zhimg.com/v2-f44a7c87436c4431b2984edbc19fbf6e_r.webp?source=2c26e567><br><img src=https://picx.zhimg.com/v2-e4eeb5dead979d52b1dd81f0e79bd167_r.webp?source=2c26e567><br><img src=https://picx.zhimg.com/v2-bfcfda2955dafb7a124788944e4b437b_r.webp?source=2c26e567><br><img src=https://picx.zhimg.com/v2-ffefc1d2ecaba81876d9fc7fd7f9a747_r.webp?source=2c26e567><br><img src=https://pica.z
